package com.rongke.model.ans;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * 微信用户的信息表 *  * @author Ans * @email 867917319@qq.com * @date 2018-08-16 18:53:30 */@TableName("tbl_wechatuser")public class TblWechatuserEntity implements Serializable {	private static final long serialVersionUID = 1L;	/**	 * 用户信息编号	 */	@TableId(type = IdType.AUTO)	private Long Id;	/**	 * 用户昵称: 需要支持表情	 */	private String nickname;	/**	 * 用户头像的链接地址	 */	private String headimgurl;	/**	 * 性别: 0 未知; 1 男性; 2 女性	 */	private Integer sex;	/**	 * 国际化语言	 */	private String language;	/**	 * 国家的英文简称	 */	private String country;	/**	 * 省份的拼音	 */	private String province;	/**	 * 城市的拼音	 */	private String city;	/**	 * 微信用户唯一编号	 */	private String openid;	/**	 * 微信公众号唯一编号	 */	private String unionid;	/**	 * 用户的特权: 微信范围的是 JSON 数组	 */	private String privilege;	/**	 * 创建时间	 */	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date createTime;	/**	 * 修改时间	 */	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date updateTime;	/**	 * 数据版本	 */	private Long version;	/**	 * 状态: 1 是有效; 8 是禁用; 88 删除	 */	private Integer status;	public Long getId() {		return Id;	}	public void setId(Long id) {		Id = id;	}	public String getNickname() {		return nickname;	}	public void setNickname(String nickname) {		this.nickname = nickname;	}	public String getHeadimgurl() {		return headimgurl;	}	public void setHeadimgurl(String headimgurl) {		this.headimgurl = headimgurl;	}	public Integer getSex() {		return sex;	}	public void setSex(Integer sex) {		this.sex = sex;	}	public String getLanguage() {		return language;	}	public void setLanguage(String language) {		this.language = language;	}	public String getCountry() {		return country;	}	public void setCountry(String country) {		this.country = country;	}	public String getProvince() {		return province;	}	public void setProvince(String province) {		this.province = province;	}	public String getCity() {		return city;	}	public void setCity(String city) {		this.city = city;	}	public String getOpenid() {		return openid;	}	public void setOpenid(String openid) {		this.openid = openid;	}	public String getUnionid() {		return unionid;	}	public void setUnionid(String unionid) {		this.unionid = unionid;	}	public String getPrivilege() {		return privilege;	}	public void setPrivilege(String privilege) {		this.privilege = privilege;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Long getVersion() {		return version;	}	public void setVersion(Long version) {		this.version = version;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}}